import React from "react";
import {Container, Row, Card, CardBody, Col} from "reactstrap";

const text = () => {
	return (
		<React.Fragment>
			<div className="page-content">
				<Container fluid>
					<Row>
						<Col lg={12}>
							<Card>
								<CardBody>
									<h4 className="card-title">Reporte del d√≠a</h4>
									<p className="card-title-desc">
										Visualiza a las personas que aparecieron delante de tus
										camaras en el dia de hoy.
									</p>
								</CardBody>
							</Card>
						</Col>
					</Row>
				</Container>
			</div>
		</React.Fragment>
	);
};

export default text;
